definition:
The naming practices set forth by a name assigning authority (#{t: NAA | h1232}). The value of this field relate the assignment or reassignment of object identifiers.

Acceptable values are one or more of #{t: NR | h1215}, #{t: OP | h1218}, or #{t: CC | h1219}.
#{g: xqpermanence | h1265}

examples:
Counts (specimens, people, particles);
Measurements (temperature, humidity, luminance);
Images (from satellites, x-rays, electron micrographs);
Time series (any of the above sampled over time);
Video, audio, seismograms, and other recordings.

Per NYT and IEEE usage, "data" can be used as a singular or plural noun as seems most appropriate in a particular context.

definition:
(Provider Object Priority) The priority of effort that the providing organization will make to keep the object or its tombstone (in the event of object loss) available online. 
Values: #{t: high | h1207}, #{t: standard | h1208}
#{g: xqpermanence | h1265}

Non-disruptive growth described objects that have content that grows over time but the growth does not in itself disrupt or displace previously recorded content.

Acceptable values are #{t: yes | h1201} and #{t: no longer | h1202}.
#{g: xqpermanence | h1265}

Current status of the project activity.

"Starting" OR "Active" OR "Complete" OR "Hiatus" OR "Pending"; Possible options need more work.
#{g: xqcitsci | h1266}

examples:
Jane -- the name of someone's daughter;
War and Peace -- the title of a novel;
W803631VATN -- a serial number engraved on a laptop computer;
http://www.example.com/foo/bar.html -- the address (URL) of a web page
